import React, { Component } from "react";
function getNum() {
  let num = Math.floor(Math.random * 10) + 1;
  console.log(num);
  return num;
}
class NumPicker extends Component {
  render() {
    return (
      <div>
        <h1>Your num is...{getNum()}</h1>
      </div>
    );
  }
}
export default NumPicker;
